import React from "react";

const ImageLinkForm = () => {
  return (
    <div>
      <p className="f3">
        {'This magic brain will detect faces in your picture. Git it a try @!@'}
      </p>
      <input type='text'></input>
      <button></button>
    </div>
  )
}

export default ImageLinkForm;
